import React from "react";
import './contact.css';
import { Button } from "react-scroll";

const Contact =() => {
    return(
      
            <div className="cnt">
                <h1 className="cnttitle">Contact</h1>
                <span className="cntdesc"> Form to reach me! </span>
                <form className="cntform">
                    <input type="text" className="name" placeholder="Name" />
                    <input type="eMail" className="email" placeholder="Mail ID" />
                    <textarea className="msg" name="msg" rows={5} placeholder="Enter Your Message" />
                    <Button className="cntbtn">Submit</Button>
                </form>
            </div>
    
);
}

export default Contact;
